import classes from './MealItem.module.css'

let MealItem = (props)=>{
    return(
        <>
        <li className={classes.meal}>
            <h1> {props.name} </h1>
            <div className={classes.description}>
                {props.description}
            </div>
            <div className={classes.prive}>
                {props.price}
            </div>
        </li>
        </>
    )
}

export default MealItem
